import { Col, Container, Row } from "react-bootstrap";

import aboutusimage from '../assets/images/aboutus-img.svg';

export const Aboutus = () => {
  return (
    <section className="aboutusbanner" id="content">
      <Container>
        <Row className="align-items-center">
          <Col xs={12} md={6} xl={7}>
            <h1>About us</h1>
            <p></p>
          </Col>
          <Col xs={12} md={6} xl={5}>
            <img src={aboutusimage} alt="About us img" />
          </Col>
        </Row>
      </Container>
    </section>
  );
};
